import React, { useState, useEffect } from 'react';
import axios from '../service/axiosConfig';
import { useNavigate } from 'react-router-dom';
import { Form, Button, Card, Alert } from 'react-bootstrap';

const PurchaseForm = ({ supplierId }) => {
  const [supplier, setSupplier] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const fetchSupplier = async () => {
      if (!supplierId) {
        console.error('No se proporcion칩 ID del proveedor');
        setError('ID de proveedor no v치lido');
        setLoading(false);
        return;
      }

      try {
        console.log('Intentando obtener proveedor con ID:', supplierId);
        const response = await axios.get(`/api/suppliers/${supplierId}`);
        setSupplier(response.data);
      } catch (error) {
        console.error('Error al obtener proveedor:', error);
        setError('Error al cargar datos del proveedor');
      } finally {
        setLoading(false);
      }
    };

    fetchSupplier();
  }, [supplierId]);

  if (loading) return <div>Cargando...</div>;
  if (error) return <Alert variant="danger">{error}</Alert>;
  if (!supplier) return <Alert variant="warning">Proveedor no encontrado</Alert>;


  const handleSubmit = (e) => {
    e.preventDefault();
    if (selectedProduct === '' && !price) {
      setError('Debe seleccionar un producto existente o agregar un nuevo producto con su precio.');
      return;
    }

    onSave({
      supplierId,
      productId: selectedProduct?.id,
      quantity,
      price,
    });
  };

  return (
    <Card className="p-4 mx-auto my-4" style={{ maxWidth: '600px' }}>
      <Card.Body>
        <Card.Title>Compra de Productos</Card.Title>
        {supplier && <Card.Subtitle className="mb-4">Proveedor: {supplier.name}</Card.Subtitle>}
        {error && <Alert variant="danger">{error}</Alert>}
        
        <Form onSubmit={handleSubmit}>
          <Form.Group className="mb-3">
            <Form.Label>Producto:</Form.Label>
            <Form.Select
              value={selectedProduct?.id || ''}
              onChange={(e) => {
                const product = products.find((p) => p.id === parseInt(e.target.value));
                setSelectedProduct(product);
                setPrice(product ? product.price : 0);
              }}
            >
              <option value="">Selecciona un Producto Existente</option>
              {products.map((product) => (
                <option key={product.id} value={product.id}>
                  {product.title}
                </option>
              ))}
            </Form.Select>
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Label>Cantidad:</Form.Label>
            <Form.Control
              type="number"
              min="1"
              value={quantity}
              onChange={(e) => setQuantity(parseInt(e.target.value))}
            />
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Label>Precio:</Form.Label>
            <Form.Control
              type="number"
              min="0"
              value={price}
              onChange={(e) => setPrice(parseFloat(e.target.value))}
              disabled={!!selectedProduct}
            />
          </Form.Group>

          <div className="d-flex justify-content-between">
            <Button variant="primary" type="submit">
              Guardar Compra
            </Button>
            <Button
              variant="secondary"
              onClick={() => navigate(`/form/product/new?supplierId=${supplierId}`)}
            >
              Agregar Nuevo Producto
            </Button>
          </div>
        </Form>
      </Card.Body>
    </Card>
  );
};

export default PurchaseForm;
